script: |
  super -f text -I q8892.spq | sort > q8892.out

inputs:
  - name: q8892.spq
    data: |
      SELECT ALL COUNT ( * ) AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE ( - col0 ) NOT BETWEEN + col0 * col2 - - col2 AND + + col0 * 77;
  - name: tab2

outputs:
  - name: q8892.out
    data: |
      3
